INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (5238, 29189, 'Abemaciclib', 'Grapefruit juice may increase the plasma concentrations of abemaciclib.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  Inhibition of hepatic CYP450 3A4 may also contribute.  The interaction has not been studied with grapefruit juice, but has been reported for other CYP450 3A4 inhibitors.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'789c4d8ec10dc3300c0357e104d9a11b7405d9925315b114c872826edfa07db42f82f7e0f156a453d5ba6941a7178a80b8abe94809619c9a0f787cd267a2b9f302dc29552c07c64537061dae8cea3666df53dde00d6bd02e2da626c8f8bf3ea75601cf505b912194fd5afbcae8f7687903489e3b41', NULL, X'');
